import React from "react";
import "../styles/MovieCard.css";

const MovieCard = ({ poster }) => {
  return (
    <div className="movie-card">
      <img src={process.env.PUBLIC_URL + poster} alt="Movie Poster" />
    </div>
  );
};

export default MovieCard;
